import React, { useState } from "react";
import axios from "axios";

function AuthPage({ onLoginSuccess, onContinueAsGuest }) {
  const [isLogin, setIsLogin] = useState(true);
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [error, setError] = useState(null);

  const toggleMode = () => {
    setError(null);
    setIsLogin(!isLogin);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError(null);
    try {
      if (isLogin) {
        // Login request
        const response = await axios.post(`${process.env.REACT_APP_API_BASE_URL}/api/auth/token`, new URLSearchParams({
          username,
          password,
        }), {
          headers: {
            'Content-Type': 'application/x-www-form-urlencoded',
          },
        });
        const token = response.data.access_token;
        localStorage.setItem("access_token", token);
        onLoginSuccess(token);
      } else {
        // Registration request
        await axios.post(`${process.env.REACT_APP_API_BASE_URL}/api/auth/register`, {
          username,
          password,
        });
        setIsLogin(true);
        setError("Регистрация успешна. Пожалуйста, войдите.");
      }
    } catch (err) {
      setError(err.response?.data?.detail || "Ошибка при запросе");
    }
  };

  return (
    <div style={styles.container}>
      <h2 style={styles.title}>{isLogin ? "Вход" : "Регистрация"}</h2>
      <form onSubmit={handleSubmit} style={styles.form}>
        <label style={styles.label} htmlFor="username">Имя пользователя</label>
        <input
          id="username"
          type="text"
          placeholder="Введите имя пользователя"
          value={username}
          onChange={(e) => setUsername(e.target.value)}
          required
          style={styles.input}
          autoComplete="username"
        />
        <label style={styles.label} htmlFor="password">Пароль</label>
        <input
          id="password"
          type="password"
          placeholder="Введите пароль"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
          required
          style={styles.input}
          autoComplete={isLogin ? "current-password" : "new-password"}
        />
      <button type="submit" style={styles.button}>
        {isLogin ? "Войти" : "Зарегистрироваться"}
      </button>
      </form>
      {error && <div style={styles.error}>{error}</div>}
      <button onClick={toggleMode} style={styles.toggleButton}>
        {isLogin ? "Создать аккаунт" : "Уже есть аккаунт? Войти"}
      </button>
      <button onClick={onContinueAsGuest} style={styles.guestButton}>
        Продолжить без авторизации
      </button>
    </div>
  );
}

const styles = {
  container: {
    maxWidth: 400,
    margin: "50px auto",
    padding: 30,
    borderRadius: 10,
    textAlign: "center",
    fontFamily: "Arial, sans-serif",
    backgroundColor: "rgba(128, 128, 128, 0.6)", // чуть более насыщенный прозрачный серый фон
    border: "1px solid #bbb",
    boxShadow: "0 4px 12px rgba(0,0,0,0.15)",
  },
  title: {
    marginBottom: 20,
    fontWeight: "bold",
    fontSize: 24,
    color: "#222",
  },
  form: {
    display: "flex",
    flexDirection: "column",
    gap: 15,
    marginBottom: 15,
  },
  label: {
    textAlign: "left",
    fontWeight: "600",
    fontSize: 14,
    color: "#333",
  },
  input: {
    padding: 12,
    fontSize: 16,
    borderRadius: 5,
    border: "1px solid #ccc",
    outline: "none",
    transition: "border-color 0.3s",
  },
  button: {
    padding: 12,
    fontSize: 16,
    cursor: "pointer",
    borderRadius: 5,
    border: "none",
    backgroundColor: "#007bff",
    color: "white",
    fontWeight: "600",
    transition: "background-color 0.3s",
  },
  buttonHover: {
    backgroundColor: "#0056b3",
  },
  toggleButton: {
    marginTop: 15,
    background: "none",
    border: "none",
    color: "#007bff",
    cursor: "pointer",
    textDecoration: "underline",
    fontSize: 14,
  },
  guestButton: {
    marginTop: 20,
    padding: 12,
    fontSize: 16,
    cursor: "pointer",
    borderRadius: 5,
    border: "1px solid #007bff",
    backgroundColor: "white",
    color: "#007bff",
    fontWeight: "600",
    transition: "background-color 0.3s",
  },
  guestButtonHover: {
    backgroundColor: "#e6f0ff",
  },
  error: {
    marginTop: 10,
    color: "red",
    fontWeight: "600",
  },
  "@keyframes gradientShift": {
    "0%": {
      backgroundPosition: "0% 50%",
    },
    "50%": {
      backgroundPosition: "100% 50%",
    },
    "100%": {
      backgroundPosition: "0% 50%",
    },
  },
};

export default AuthPage;
